type UserAuthCardProps = {
    authorizationStatus: string;
}

function UserAuthCard({authorizationStatus}: UserAuthCardProps): JSX.Element {
  return (
    <ul className="header__nav-list">
      <li className="header__nav-item user">
        <div className="header__nav-profile">
          <div className="header__avatar-wrapper user__avatar-wrapper"></div>
          <span className="header__user-name user__name">{authorizationStatus === 'AUTH' ? 'some' : ''}</span>
        </div>
      </li>
      <li className="header__nav-item">
        <a className="header__nav-link" href="#">
          <span className="header__signout">{authorizationStatus === 'AUTH' ? 'Sign out' : 'Sign in'}</span>
        </a>
      </li>
    </ul>
  );
}

export default UserAuthCard;
